import React, {Component} from 'react';
import PostList from "../mainList";
import {Col, Row, Button} from "react-bootstrap";


class Content extends Component {
    render() {
        return (
            <main role={"main"} className={"content"}>
                <div className="container">
                    <div className={"box"}>
                            <Row className={"box-one"}>
                                <Col>
                                    <img src={window.location.origin + '/images/teams/bjk-lg@3x.png'} className="d-inline-block align-top" alt="" height="32" /><h1>Beşiktaş JK</h1>
                                </Col>
                                <Col><Button variant="primary">Confirm</Button></Col>
                            </Row>
                            <Row className={"box-two"}>
                                <Col>
                                    <h2>All Players</h2>
                                </Col>
                                <Col>
                                    <h2>Lineup</h2>
                                </Col>
                                <Col>
                                    <h2>Substitutes</h2>
                                </Col>
                            </Row>
                    </div>
                </div>

                <div className="container">
                    <PostList />
                </div>
            </main>
        );
    }
}

export default Content;
